import React from "react";
import styled from "styled-components";
import InnerImgSlider from "../../innersmallslider/InnerImgSlider";
export default function TreatmentDetailsContainer() {
  let details = [
    {
      Treatment1: "Curative Treatment",
      Treamtent1Detail:
        "Curative or therapeutic care refers in part to treatments and therapies provided to a patient with the goal of curing an illness or condition. The terms are also used for treatments that delay disease progression even when a cure is not possible.",
      ExampleOfTreatmentAvailableHeading:
        "Example Of Curative Treamtent Available In Our Hospital",
      ExampleOfTreatmentAvailable: [
        {
          treatment: "Cancer Curative Treatment",
        },
        {
          treatment: "Sar Dard",
        },
        {
          treatment: "Stomatch Pain",
        },
        {
          treatment: "Brain",
        },
        {
          treatment: "Legs",
        },
        {
          treatment: "Hands",
        },
      ],
      data: [
        {
          img: "/Images/workforyou1.jpg",
          disc: "Lorem ipsum dolor sit amet consectetur adipisicing elit.Eveniet iure rerum obcaecati et laborum earum!",
        },
        {
          img: "/Images/workforyou2.jpg",
          disc: "Lorem ipsum dolor sit amet consectetur adipisicing elit.Eveniet iure rerum obcaecati et laborum earum!",
        },
        {
          img: "/Images/workforyou3.jpg",
          disc: "Lorem ipsum dolor sit amet consectetur adipisicing elit.Eveniet iure rerum obcaecati et laborum earum!",
        },
        {
          img: "/Images/workforyou4.jpg",
          disc: "Lorem ipsum dolor sit amet consectetur adipisicing elit.Eveniet iure rerum obcaecati et laborum earum!",
        },
      ],
    },
  ];

  const Patient = () => {
    alert("Patient Will Died");
  };
  return (
    <MainContainer>
      <TreatmentHeadingContainers>
        <p>Types Of Treatment</p>
      </TreatmentHeadingContainers>
      {details.map((item, index) => {
        return (
          <TreatmentDetails>
            <TypesOfTreatment>
              <p key={index}>{item.Treatment1}</p>
            </TypesOfTreatment>
            <TreatmentInfo>
              <TreatmentInfoContainer>
                <TreatmentDetailWithImageSlider>
                  <TreatmentInformation>
                    <p key={index}>{item.Treamtent1Detail}</p>
                  </TreatmentInformation>
                  <TreatmentSlider>
                    <InnerImgSlider data={item.data} index={index} />
                  </TreatmentSlider>
                </TreatmentDetailWithImageSlider>
                <ExampleOfTreatment>
                  <p key={index}>{item.ExampleOfTreatmentAvailableHeading}</p>
                  <TreatmentContainer>
                    {item.ExampleOfTreatmentAvailable.map((x, i) => {
                      return <li>{x.treatment}</li>;
                    })}
                  </TreatmentContainer>
                </ExampleOfTreatment>
              </TreatmentInfoContainer>
              <ButtonForView><button onClick={Patient}>View Details</button></ButtonForView>
            </TreatmentInfo>
          </TreatmentDetails>
        );
      })}
    </MainContainer>
  );
}

const MainContainer = styled.div`
  width: 90%;
  position: relative;
  left: 80px;
  top: 40px;
  text-align: center;
  z-index: -1;
`;

const TreatmentHeadingContainers = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  margin: 3%;

  p {
    text-align: center;
    font-family: "Bree Serif", serif;
    font-size: 1.8rem;
    font-weight: bold;
    box-shadow: rgba(0, 0, 0, 0.1) 0px 2px 4px, rgba(0, 0, 0, 0.1) 0px 8px 16px;
    background-color: white;
    color: #090b13;
    padding: 4px;
    margin-top: 30px;
    border-radius: 5px;
  }
`;

const TreatmentDetails = styled.div`
  box-shadow: rgba(0, 0, 0, 0.1) 0px 2px 4px, rgba(0, 0, 0, 0.1) 0px 8px 16px;
  border-radius: 5px;
  background-color: white;
`;

// container for showing the meaning of the type of treatment
const TreatmentInfo = styled.div`
  border: 2px solid crimson;
  width: 100%;
`;

const TypesOfTreatment = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  margin: 2%;
  border: 2px solid aqua;
  p {
    text-align: center;
    font-family: "Bree Serif", serif;
    font-size: 1.5rem;
    color: white;
    border-radius: 5px;
    font-weight: bold;
    display: inline-flex;
    padding: 4px;
    margin-top: 30px;
    box-shadow: rgba(0, 0, 0, 0.1) 0px 2px 4px, rgba(0, 0, 0, 0.1) 0px 8px 16px;
    border-radius: 5px;
    background-color: white;
    color: #090b13;
  }
`;

const TreatmentInfoContainer = styled.div`
  display: flex;
  flex-direction: row;
  border: 2px solid yellowgreen;
  width: 100%;
`;

const TreatmentDetailWithImageSlider = styled.div`
  width: 75%;
  display: flex;
  flex-direction: column;
  border: 2px solid red;
`;

const TreatmentInformation = styled.div`
  display: flex;
  flex-direction: column;
  flex-wrap: wrap;
  align-items: center;
  justify-content: center;
  margin: 2%;
  border: 2px solid aquamarine;

  p {
    text-align: center;
    color: #090b13;
    font-family: "Roboto", sans-serif;
    word-spacing: 0.5rem;
    line-height: 1.4rem;
  }
`;

const TreatmentSlider = styled.div`
  width: 100%;
  border: 2px solid grey;
`;

const ExampleOfTreatment = styled.div`
  width: 100%;
  box-shadow: rgba(0, 0, 0, 0.1) 0px 2px 4px, rgba(0, 0, 0, 0.1) 0px 8px 16px;
  border-radius: 5px;
  background-color: white;
  padding: 3px;
  margin: 10px;
  background-color: rgb(240, 233, 223);
  border: 2px solid pink;

  p {
    text-align: center;
    color: #090b13;
    font-family: "Roboto", sans-serif;
    word-spacing: 0.5rem;
    line-height: 1.4rem;
    padding: 8px;
  }
`;

const TreatmentContainer = styled.div`
  padding: 4px;
  margin: 4px;

  li {
    text-align: left;
  }
`;

const ButtonForView = styled.div`
  border: 3px solid #090b13;
margin-top:20px;
  button {
    color: #090b13;
    font-family: "Roboto", sans-serif;
    font-size: 1rem;
    padding: 3px;
    margin-top: 30px;
    border-radius: 10px;
    cursor: pointer;
    transition: all 0.3s ease-in-out;
    box-shadow: rgba(0, 0, 0, 0.1) 0px 2px 4px, rgba(0, 0, 0, 0.1) 0px 8px 16px;
    border-radius: 5px;
    background-color: white;
    &:hover {
      transform: scale(1.06);
      background-color: #090b13;
      color: white;
    }
  }
`;
